import React, { useEffect, useState } from "react";
import "./Overview.css";
import SuggestionCard from "./Suggestion/SuggestionCard";
import CaloriesCard from "./Calories/CaloriesCard";
import StepsCard from "./Steps/StepsCard";
import WorkoutCard from "./Workout/WorkoutCard";
import Suggestion from "./Suggestion/Suggestion";
import Calories from "./Calories/Calories";
import Steps from "./Steps/Steps";
import Workout from "./Workout/Workout";
import GoalsCard from "./Goals/GoalsCard";

const Overview = ({selectedOverviewComponent, returnBackToInfoPage}) => {

  useEffect(() => {
    console.log("WTF");
    returnBackToInfoPage();
  }, []);

  return <div className="overview">{selectedOverviewComponent}</div>;
};

export default Overview;


const InfoPage = ({ setSelectedOverviewComponent, returnBackToInfoPage }) => {
  return (
    <>
      <div className="info-page">
        <div
          className="suggestions"
          onClick={() => setSelectedOverviewComponent(<Suggestion />)}
        >
          <SuggestionCard />
        </div>
        <div
          onClick={() =>
            setSelectedOverviewComponent(
              <Workout returnBackToInfoPage={returnBackToInfoPage} />
            )
          }
        >
          <WorkoutCard />
        </div>
        <div onClick={() => setSelectedOverviewComponent(<Calories />)}>
          <CaloriesCard />
        </div>
        <div onClick={() => setSelectedOverviewComponent(<Steps />)}>
          <StepsCard />
        </div>
        <div className="goal-process">
          <GoalsCard />
        </div>
      </div>
      <div className="schedule-page"></div>
    </>
  );
};
